import React, { useState } from 'react';
import appImg from './screen.png'
import logoImg from './logo.png'
const images = [
  'https://cdn.discordapp.com/attachments/1125374453220638731/1133366802211160114/inabatron_a_brown_haired_girl_in_a_whimsical_cozy_fairy_tale_ci_0c03d64d-75c6-4210-a6cd-5f9f46608760.png',

  appImg,
  // Add more image URLs as needed
];

const Carousel = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  const prevImage = () => {
    setCurrentIndex((prevIndex) => (prevIndex === 0 ? images.length - 1 : prevIndex - 1));
  };

  const nextImage = () => {
    setCurrentIndex((prevIndex) => (prevIndex === images.length - 1 ? 0 : prevIndex + 1));
  };

  return (
    <div className="relative w-full">
      <img src={images[currentIndex]} alt={`Image ${currentIndex + 1}`} className="w-full w-auto max-w-full" />
      <div className="absolute inset-0 flex items-center justify-between">
        <button onClick={prevImage} className="text-white text-2xl px-4 py-2 bg-gray-500 rounded-lg">
          &lt;
        </button>
        <button onClick={nextImage} className="text-white text-2xl px-4 py-2 bg-gray-500 rounded-lg">
          &gt;
        </button>
      </div>
    </div>
  );
};

export default Carousel;
